                $.ajax({
                    url: autocompleteUrl,
                    type: 'GET',
                    cache: false,
                    dataType: 'json',
                    success: function (json) {
                        var groupData = JSON.stringify(json.responseText);
                        var parse = JSON.parse(groupData);
                        response($.map(parse, function (data) {
                            return {
                                label: data.value,
                                value: data.value,
                                id: data.id
                            };
                        }));
                    },
                    error: function (textStatus, errorThrown)");
